/**
 * Base64 编码的测试图片数据
 * 用于排除网络问题，测试图片解码/渲染性能
 * 
 * 这些是 800x600 像素的彩色测试图片
 * 格式：data:image/png;base64,<base64数据>
 * 
 * 如何生成自己的 Base64 图片：
 * 1. 在线工具：https://www.base64-image.de/
 * 2. Node.js: Buffer.from(fs.readFileSync('image.png')).toString('base64')
 * 3. 浏览器控制台：
 *    const img = new Image();
 *    img.src = 'your-image-url';
 *    img.onload = () => {
 *      const canvas = document.createElement('canvas');
 *      canvas.width = img.width;
 *      canvas.height = img.height;
 *      const ctx = canvas.getContext('2d');
 *      ctx.drawImage(img, 0, 0);
 *      console.log(canvas.toDataURL('image/png'));
 *    };
 */

// 注意：这里提供的是占位符 Base64 图片（1x1 像素）
// 实际使用时，你需要替换为真实的 800x600 图片的 Base64 编码
// 真实的 Base64 字符串会很长（约 100KB+）

// 图片1: 800x600 红色测试图片
export const base64Image1 = "data:image/jpeg;base64,";

// 图片2: 800x600 蓝色测试图片
export const base64Image2 = "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAADUlEQVR42mNkYPhfDwAChAGA60e6kgAAAABJRU5ErkJggg==";

// 图片3: 800x600 绿色测试图片
